import React from 'react'
import {Route, Redirect } from 'react-router-dom';
import { connect } from 'react-redux';
import PropTypes from 'prop-types';

const PrivateAdminRoute = (props) => {
    const { authenticated, component, computedMatch :{params : { fullname }} } = props;
    console.log("provate route",fullname === props.fullname);
    let adminRoute = (authenticated) ? (
        <Route component={component} />
    ) : (
        <Redirect to='/' />
    )
    // console.log("provate route",Route);

    return (adminRoute)
}

const mapStateToProps = (state) => ({
    authenticated: state.admin.authenticated,
    fullname: state.admin.fullname

});

PrivateAdminRoute.prototype = {
    admin: PropTypes.object
}

export default connect(mapStateToProps)(PrivateAdminRoute);
